import { Link } from "react-router-dom"
import Card from "../Card"
const Comparecard = (props)=> {
    const {compareValue,mobileData}=props
    return(
        <div className="compareCard">
           
        {
        mobileData.filter((val) => {

            return compareValue.indexOf(val.model) > -1

        }).map((dat) => {
            return (
                <Card image={dat.image[0]}/>
            
                
            )
        })}
        {
            compareValue.length >0? <div>
            <Link to="/compare">
             
             <button className="buyLink">comp</button>
         </Link>
         </div>:""
        }
        </div>
    )

}
export default  Comparecard ;
